"33064" : {
"id":33064,
"typeIconPath":"data/icons/ArchiMate/AllViewRef.png",
"data" : [
{
"lang":"nl",
"name":"Beoordelen",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bij de beoordeling wordt vastgesteld of de cli&#235;nt toegang heeft tot jeugdhulp. De toegang tot jeugdhulp kan door verschillende partijen bepaald worden: &nbsp;<p style=\"margin-top: 3pt;\">* De gemeente, of bijvoorbeeld een sociaal wijkteam in opdracht van de gemeente, beoordeelt de cli&#235;nt en legt in een beschikking de toegang tot jeugdhulp vast. &nbsp;<p style=\"margin-top: 3pt;\">* Een huisarts, jeugdarts of medisch specialist verwijst een cli&#235;nt door naar jeugdhulp &nbsp;<p style=\"margin-top: 3pt;\">* Een rechter, Raad voor de Kinderbescherming of Officier van Justitie legt de cli&#235;nt jeugdhulp op.&nbsp;<p style=\"margin-top: 3pt;\">* Een gecertificeerde instelling kan naast jeugdbescherming en jeugdreclassering, ook reguliere jeugdhulp bepalen in overleg met de gemeente. Na overleg met de gemeente bepaalt gecertificeerde instelling welke jeugdhulp, die door de gemeente is ingekocht, wordt ingezet. (Zie voor meer informatie over toeleiding door een gecertificeerde instelling de handreiking 'Gebruik van iJw-berichtenverkeer door gemeenten en gecertificeerde jeugdzorginstellingen' en de Factsheet Woonplaatsbeginsel.)&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Inspanningsgerichte en outputgerichte uitvoeringsvariant</b>&nbsp;<p style=\"margin-top: 3pt;\">Bij de beoordeling wordt vastgesteld welke jeugdhulp een cli&#235;nt nodig heeft, hoeveel jeugdhulp (omvang) en hoe lang (voor welke periode). Wanneer de beoordeling wordt uitgevoerd door een andere partij dan de gemeente, vraagt de aanbieder daarna bij de gemeente voor de betreffende jeugdhulp een toewijzing aan. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Naar aanleiding van de beoordeling stelt de gemeente een beschikking vast voor de cli&#235;nt. Hierin wordt vastgelegd welke jeugdhulpproducten, met welke omvang en voor welke periode, de cli&#235;nt nodig heeft. E&#233;n beschikking is het resultaat van &#233;&#233;n beoordeling en kan meerdere producten bevatten: de toegewezen producten. Binnen de Jeugdwet is het ook mogelijk dat voor ieder product voor &#233;&#233;n cli&#235;nt een aparte beschikking wordt opgesteld. Deze beschikkingen kunnen gelijktijdig geldig zijn. Ook is het mogelijk om een aanbieder een budget mee te geven voor een vooraf gedefinieerde periode. Het is dan aan de aanbieder te bepalen welke zorg ingezet moet worden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Taakgerichte uitvoeringsvariant&nbsp;<p style=\"margin-top: 3pt;\"></b>Binnen de uitvoeringsvariant Taakgericht bepaalt de jeugdhulpaanbieder zelf, in opdracht van de gemeente, of de cli&#235;nt toegang heeft tot jeugdhulp. De gemeente speelt geen rol bij de beoordeling en stelt niet op niveau van de individuele cli&#235;nt een beschikking vast.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
