,
"33686" : {
"id":33686,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Vaststellen beschikking",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Naar aanleiding van de beoordeling stelt de gemeente een beschikking</span><span style=\" font-size: 9pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">1)</span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 9pt;\"> &nbsp;vast voor de cli&#235;nt. Hierin wordt vastgelegd welke jeugdhulpproducten, met welke omvang en voor welke periode, de cli&#235;nt nodig heeft. E&#233;n beschikking is het resultaat van &#233;&#233;n beoordeling en kan meerdere producten bevatten: de toegewezen producten. Binnen de Jeugdwet is het ook mogelijk dat voor ieder product voor &#233;&#233;n cli&#235;nt een aparte beschikking wordt opgesteld. Deze beschikkingen kunnen gelijktijdig geldig zijn. De beschikking wordt niet gecommuniceerd via het berichtenverkeer.&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\">1) </span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 9pt;\">Wanneer de toegang niet door de gemeente zelf bepaald is, kan de gemeente er voor kiezen om dit niet in een offici&#235;le beschikking vast te leggen. Voor het berichtenverkeer gaan we er vanuit dat er altijd een 'beschikking' is afgegeven. Wanneer er geen offici&#235;le beschikking is afgegeven, wordt het recht op jeugdhulp toch behandeld als ware het vervat in een beschikking.</span><span style=\" font-size: 9pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
,
