"name":"Berichtspecificaties worden als volgt opgebouwd in UML: * Een berichtklasse is een UML klasse die als onderdeel van een bericht gebruikt wordt. Een berichtklasse bevat √©√©n of meer berichtelementen. * Een berichtelement is een UML attribuut binnen een berichtklasse. Een berichtelement is gekoppeld aan een logisch datatype (LDT) of een composite datatype (CDT).   Om vanuit het bericht te zien hoe een datatype is opgebouwd en welke codelijst eventueel gebruikt wordt:  > klik binnen de berichtview het berichtelement aan. > Onder \"Eigenschappen\" is de link naar het type te vinden. > Vanuit het type kan vervolgens onder \"Komt voor op\" de view geselecteerd worden met de details van het datatype.  De XML schema definities per bericht worden afgeleid van UML klassenview van het bericht.  Door links onder de berichtview te klikken op \"Bericht details view\" kan bovendien getoond worden welke regels van toepassing zijn op de berichtelementen en berichtklassen.",
"type":"Tekenvorm",
