"28124" : {
"id":28124,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV032: Welke retourcode moet gevuld worden in het retourbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Welke retourcode gevuld moet worden, wordt bepaald door controle op basis waarvan het bericht wordt afgekeurd. De retourcode wordt meegegeven bij de berichtklasse waarop de controle van toepassing is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Technische regels, condities en constraints die niet op basis van een XSD &#243;f XSLT validatie gecontroleerd kunnen worden, hebben een eigen retourcode. Overige regels gebruiken retourcode 0001 (Bericht is technisch onjuist). Daarnaast zijn nog een aantal algemene retourcodes beschikbaar.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een ontvangen bericht wordt op vier niveaus gecontroleerd.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Niveau 1:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op leesbaarheid en gevalideerd tegen het XSD. &nbsp;<p style=\"margin-top: 3pt;\">Indien het bericht niet leesbaar is of niet valideert, krijgt de afzender een foutmelding. Er wordt geen retourbericht verzonden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau</b> <b>2:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd tegen alle regels (technische regels, condities en constraints) die binnen het bericht zelf te controleren zijn. Voor deze regels zijn XSLT's beschikbaar die gebruikt kunnen worden om de controles uit te voeren. &nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd bevat het retourbericht alleen de Header met retourcode 0001 (Bericht is technisch onjuist). Wanneer de ter beschikking gestelde XSLT's gebruikt zijn, wordt bovendien het versienummer van de XSLT's meegegeven.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau 3:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op alle overige regels die niet binnen het bestand zelf gecontroleerd kunnen worden. Dit betekent dat gecontroleerd wordt op:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Systeemdatum om te bepalen of de dagtekening niet in de toekomst ligt;<b></b></li><li>Alle berichtov<span style=\" font-family: Arial;\">erstijgende technische regels;<b></b></span></li><li><span style=\" font-family: Arial;\">Codelijsten die wel onderdeel zijn van de standaard, maar niet als enumeratie in de XSD's zijn opgenomen, zoals de gemeentelijke indeling van CBS.<b></ul></b>&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten zijn geconstateerd in &#233;&#233;n van de berichtklassen die horen bij een Client, dan bevat het retourbericht de header en alle berichtklassen uit het heenbericht die horen bij die Client, voorzien van retourcode(s). De retourcode die hoort bij de regel op basis waarvan het bericht wordt afgekeurd, wordt ingevuld bij de berichtklasse waarin de fout is geconstateerd. Let wel: aangezien de declaratie/facturatie gegevens kan bevatten over meer clienten, kan ook het retourbericht gegevens bevatten over meer clienten.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau 4:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op aanvullende afspraken die niet gecontroleerd kunnen worden op basis van informatie die binnen de standaard wordt uitgewisseld. Het gaat bijvoorbeeld om controles t.o.v. contractafspraken. Voor deze controles zijn een beperkt aantal retourcodes beschikbaar, het gebruik hiervan is beperkt tot:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Een declaratie-/factuurbericht kan worden afgekeurd met retourcodes 0611, 8004, 8847, 8849 t/m 8856. </li><li>Verzoek om toewijzingbericht kan worden afgekeurd met retourcodes 8857 t/m 8862. Deze retourcode wordt gevuld bij de berichtklasse AangevraagdProduct waarop de afwijking geconstateerd is.</ul>&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">Let op: Clienten </span>waarvoor g&#233;&#233;n fouten zijn geconstateerd, worden niet opgenomen in het retourbericht (zie OP065).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Bijvoorbeeld:</b> De gemeente ontvangt e<span style=\" font-family: Arial;\">en </span><span style=\" font-family: Arial;\">verwijdering (status aanlevering 3) van</span><span style=\" font-family: Arial;\"></span> een startbericht, maar heeft de eerste aanlevering van het StartProduct niet ontvangen. Het bericht wordt dan afgekeurd op basis van TR063.&nbsp;<p style=\"margin-top: 3pt;\">In het retourbericht voor deze voorbeeld foutsituatie worden de volgende retourcodes gevuld:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Header: Retourcode 0200 (Geen opmerkingen over deze berichtklasse)</li><li>Client: Retourcode 0200 (Geen opmerkingen over deze berichtklasse)</li><li>StartProduct: Retourcode 9063 (Het bericht kan niet verwerkt worden omdat geen eerder bericht ontvangen is)</ul>&nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO304","id":27964,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO Retour","id":28031,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW304","id":28431,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW Retour","id":29210,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV032"}}}]
}
]
}
,
"28097" : {
"id":28097,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP297: Indien de zorgverlenercode van de verwijzer bekend is, dient de aanbieder deze mee te geven in het verzoek om toewijzing.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 11pt;\">Indien bij de verwijzing van huisarts, Jeugdarts, Gecertificeerde instelling of Medisch specialist een zorgverlenerscode (AGB-code van het Zorgpartijtype Zorgverlener) is meegegeven, dient bij de verwijzing deze ZorgverlenerCode gevuld te worden. Indien de zorgaanbieder deze informatie niet heeft, mag worden volstaan met de naam van de verwijzer.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 11pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"JW315","id":28738,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO315","id":28315,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP297"}}}]
}
]
}
,
