"27941" : {
"id":27941,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP266: De aanbieder declareert of factureert een zorg- of ondersteuningsproduct dat aansluit bij de toewijzing.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien de gemeente een toewijzingbericht verzonden heeft, declareert de aanbieder hetzelfde of een nader gespecificeerd zorg- of ondersteuningsproduct. Dit betekent dat de declaratie of factuur hetzelfde &#243;f (een) nader gespecificeerd(e) zorg- of ondersteuningsproduct(en) bevat als de toewijzing.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Bij een specifieke toewijzing (productcategorie en productcode zijn beiden gevuld in de toewijzing) wordt hetzelfde zorg- of ondersteuningsproduct gedeclareerd of gefactuureerd, ofwel dezelfde combinatie van productcategorie en productcode. </li><li>Bij een aspecifieke toewijzing (in de toewijzing is alleen productcategorie gevuld; productcode is leeg) worden &#233;&#233;n of meer nader gespecificeerde zorg- of ondersteuningsproducten gedeclareerd of gefactureerd. Dat betekent dat de aanbieder binnen de toegewezen productcategorie &#233;&#233;n of meer productcode(s) declareert of factureert die volgens de gehanteerde productcodelijst horen bij die productcategorie.</li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP266","geen technische regels":false}}}]
}
]
}
