"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een inzending met status aanlevering '2' (Gewijzigde aanlevering) mag alleen indien eerder voor dezelfde Client een bericht met Status aanlevering '1' (Eerste aanlevering) is ingezonden.&nbsp;<p style=\"margin-top: 3pt;\">De meest recente aanlevering, met status aanlevering '2' (Gewijzigde aanlevering), vervangt de eerder verzonden aanlevering met status aanlevering '1' of '2'. </span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO401","id":30330,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Eb","id":30351,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR103"}}}]
