"31537" : {
"id":31537,
"typeIconPath":"data/icons/ArchiMate/AllViewRef.png",
"data" : [
{
"lang":"nl",
"name":"Leveren",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De informatiestromen rondom de levering bieden inzicht in het feitelijk plaatsvinden van jeugdhulp. Met de Start- en Stopberichten is het voor de gemeente mogelijk om een cli&#235;nt te volgen, en te sturen op het feitelijk plaatsvinden van zorg en ondersteuning. Gemeenten zijn vrij in de mate waarin zij regie op cli&#235;ntniveau willen voeren, echter in het berichtenverkeer is het gebruik van regieberichten verplicht voor Inspannings- en outputgericht werken. Hierbij maken gemeente en aanbieder afspraken over de invulling/betekenis van de start- en einddatums in de regieberichten. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><b>Inspanningsgerichte en outputgerichte uitvoeringsvariant </b>&nbsp;<p style=\"margin-top: 3pt;\">Voor de uitvoeringsvarianten Inspanningsgericht en Outputgericht (met uitzondering van de Gecertificeerde Instellingen) wordt gebruik gemaakt van de regieberichten. De aanbieder geeft aan de gemeente door wanneer de levering daadwerkelijk gestart wordt. De aanbieder reageert daarmee op de opdracht die de gemeente verstrekt heeft (toewijzing). Wanneer de jeugdhulp be&#235;indigd wordt, geeft de aanbieder dit ook door aan de gemeente in een stopbericht. In het geval dat de levering tijdelijk be&#235;indigd wordt, moet de aanbieder opnieuw doorgeven wanneer de levering hervat wordt of wanneer deze definitief be&#235;indigd wordt.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><b>Taakgerichte uitvoeringsvariant </b>&nbsp;<p style=\"margin-top: 3pt;\">In de uitvoeringsvariant Taakgericht verloopt de toegang tot jeugdhulp via de aanbieder, binnen de vooraf bepaalde kaders. In het kader van regievoering door de gemeente kan een afspraak tussen gemeente en aanbieder worden gemaakt over het gebruik van de informatiestromen voor start en stop jeugdhulp. De berichten staan in dat geval op zichzelf en zijn niet gerelateerd aan een toewijzing en/of een declaratie.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
