"28409" : {
"id":28409,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR318: Indien iedere DeclaratiePeriode zorg is geleverd, moet DeclaratiePeriode BeginDatum van de volgende declaratie-/factuurperiode precies √©√©n dag na de DeclaratiePeriode EindDatum van de voorgaande declaratie-/factuurperiode liggen.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Als gedurende &#233;&#233;n of meerdere DeclaratiePerioden door de aanbieder geen zorg is geleverd, zal de DeclaratiePeriode Begindatum van de volgende declaratie/factuur precies 1 of meer keer de duur van de afgesproken DeclaratiePeriode + 1 dag na de DeclaratiePeriode Einddatum van de laatst ingediende declaratie/factuur van dezelfde aanbieder liggen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld:&nbsp;<p style=\"margin-top: 3pt;\"></b>De afgesproken declaratie-/factuurperiode is maandelijks. De duur van de DeclaratiePeriode is dus 1 maand.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">In februari en maart wordt zorg geleverd, die respectievelijk in maart en april wordt gedeclareerd/gefactureerd.&nbsp;<p style=\"margin-top: 3pt;\">In april en mei wordt geen zorg geleverd en hoeven er ook geen correcties op vorige declaraties/facturen te worden ingediend.</span><span style=\" font-size: 10pt; font-family: Arial;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De facturen die worden verstuurd zullen de volgende DeclaratiePerioden bevatten:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Factuur Maart: 01-03-2019 t/m 31-03-2019</li><li>Factuur April: 01-04-2019 t/m 30-04-2019</li><li>Factuur Juli: 01-07-2019 t/m 31-07-2019 (01-07-2019 is 2 maanden + 1 dag na 30-04-2019)</li><li>Factuur Augustus: 01-08-2019 t/m 31-08-2019</ul>&nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CDT_DeclaratieFactuurIdentificatie","id":30604,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR318","niveau":"berichtoverstijgend"}}}]
}
]
}
