"28598" : {
"id":28598,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV032: Welke retourcode moet gevuld worden in het retourbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Welke retourcode gevuld moet worden, wordt bepaald door controle op basis waarvan het bericht wordt afgekeurd. De retourcode wordt meegegeven bij de berichtklasse waarop de controle van toepassing is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Technische regels, condities en constraints die niet op basis van een XSD &#243;f XSLT validatie gecontroleerd kunnen worden, hebben een eigen retourcode. Overige regels gebruiken retourcode 0001 (Bericht is technisch onjuist). Daarnaast zijn nog een aantal algemene retourcodes beschikbaar.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een ontvangen bericht wordt op drie niveau's gecontroleerd.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Niveau 1:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op leesbaarheid en gevalideerd tegen het XSD. &nbsp;<p style=\"margin-top: 3pt;\">Indien het bericht niet leesbaar is of niet valideert, krijgt de afzender een foutmelding. Indien nodig neemt de ontvanger buiten het berichtenverkeer contact op met de verzender. Er wordt geen retourbericht verzonden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau</b> <b>2:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd tegen alle regels (technische regels, condities en constraints) die binnen het bericht zelf te controleren zijn. Voor deze regels zijn XSLT's beschikbaar die gebruikt kunnen worden om de controles uit te voeren. &nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd bevat het retourbericht alleen de Header met retourcode 0001 (Bericht is technisch onjuist). Wanneer de ter beschikking gestelde XSLT's gebruikt zijn, wordt bovendien het versienummer van de XSLT's meegegeven.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau 3:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op alle overige zaken die beschreven zijn als onderdeel van de standaard, maar die niet binnen het bestand zelf gecontroleerd kunnen worden. Dit betekent dat gecontroleerd wordt op:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Systeemdatum om te bepalen of de dagtekening niet in de toekomst ligt;<b></b></li><li>Alle berichtoverstijgende technische regels;<b></b></li><li>Codelijsten die wel onderdeel zijn van de standaard, maar niet als enumeratie in de XSD's zijn opgenomen, zoals de gemeentelijke indeling van CBS.<b></b></li><li>De declaratie-/factuurberichten worden bovendien gecontroleerd tegen bijv. de contractafspraken.<b></ul></b>&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten zijn geconstateerd in &#233;&#233;n van de berichtklassen die horen bij &#233;&#233;n Client bevat het retourbericht de header en alle berichtklassen uit het heenbericht die horen bij de Client(en) waarbinnen de fouten geconstateerd zijn, voorzien van retourcode(s).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"EB retour","id":30341,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV032"}}}]
}
]
}
