"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het toewijzingsbericht wordt gevuld conform IV093. De ingangsdatum en einddatum van de toewijzing kan afwijken van de in de VOW gevraagde data in het geval van toewijzen met terugwerkende kracht. Het ToewijzingNummer wijkt af indien voor de gevraagde wijziging een nieuwe toewijzing afgegeven moet worden (conform OP257 en IV066). &nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP348"}}}]
