"28266" : {
"id":28266,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP289: Bij een toegewezen product kan slechts √©√©n Startbericht actueel zijn.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Op ieder moment kan er maar &#233;&#233;n begindatum zijn van een levering die gestart is naar aanleiding van &#233;&#233;n toegewezen product of productcategorie. Een startbericht kan dus nooit volgen op een startbericht voor hetzelfde toegewezen product, tenzij er voor dat toegewezen product een (tijdelijke) beeindiging is doorgegeven in een stopbericht, &#243;f tenzij het een correctie betreft van het eerdere startbericht (zie IV008). &nbsp;<p style=\"margin-top: 3pt;\">Let op: een product kan hierbij niet gevuld zijn (generiek) of bestaan uit alleen een productcategorie (aspecifiek) ofwel een productcategorie en een productcode (specifiek).&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO305","id":28387,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW307","id":29164,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW305","id":29812,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO307","id":29997,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP289"}}}]
}
]
}
,
"28269" : {
"id":28269,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV042: Hoe moet de omvang van te leveren of geleverde ondersteuning gevuld worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">In het verzoek om toewijzing en in de toewijzing wordt de omvang van de te leveren ondersteuning opgegeven in het berichtelement Omvang, dat bestaat uit de elementen Volume, Eenheid en Frequentie. Deze elementen dienen in onderlinge samenhang gevuld te worden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In het declaratie- of factuurbericht wordt de omvang van de geleverde ondersteuning tijdens de betreffende productperiode opgegeven in de berichtelementen GeleverdVolume en Eenheid. Deze elementen dienen in onderlinge samenhang gevuld te worden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Als Eenheid de waarde 83 (Euro's) bevat, wordt in GeleverdVolume een bedrag gevuld in eurocent. Bijvoorbeeld 10000 is gelijk aan tienduizend eurocent oftewel 100 euro.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Als Eenheid een andere waarde dan 83 (Euro's) bevat, wordt GeleverdVolume gevuld met een geheel getal, zonder decimalen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeelden&nbsp;<p style=\"margin-top: 3pt;\"></b>&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld 1A: &nbsp;<p style=\"margin-top: 3pt;\">In een inspanningsgerichte toewijzing wordt aangegeven dat een client recht heeft op 5 dagdelen per week ondersteuning. Omvang in de toewijzing wordt als volgt gevuld:&nbsp;<p style=\"margin-top: 3pt;\">Volume: 5&nbsp;<p style=\"margin-top: 3pt;\">Eenheid: 16 (Dagdeel (4 uur))&nbsp;<p style=\"margin-top: 3pt;\">Frequentie: 2 (Per week)&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld 2A: &nbsp;<p style=\"margin-top: 3pt;\">In een outputgerichte toewijzing wordt aangegeven dat een client ondersteuning krijgt voor een vast bedrag van 200 euro per maand. Omvang in de toewijzing wordt als volgt gevuld:&nbsp;<p style=\"margin-top: 3pt;\">Volume: 20000&nbsp;<p style=\"margin-top: 3pt;\">Eenheid: 83 (Euro's)&nbsp;<p style=\"margin-top: 3pt;\">Frequentie: 4 (Per maand)&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld 1B: &nbsp;<p style=\"margin-top: 3pt;\">In een declaratie wordt aangegeven dat in de afgelopen productperiode in totaal 20 dagdelen ondersteuning is geleverd. Dit wordt als volgt aangegeven in het declaratiebericht:&nbsp;<p style=\"margin-top: 3pt;\">GeleverdVolume: 20&nbsp;<p style=\"margin-top: 3pt;\">Eenheid: 16 (Dagdeel (4 uur))&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld 2B: &nbsp;<p style=\"margin-top: 3pt;\">In een factuur wordt aangegeven dat in de afgelopen productperiode ondersteuning is geleverd volgens het vaste, afgesproken maandbedrag van 200 euro. Dit wordt als volgt aangegeven in het declaratiebericht:&nbsp;<p style=\"margin-top: 3pt;\">GeleverdVolume: 20000&nbsp;<p style=\"margin-top: 3pt;\">Eenheid: 83 (Euro's)<span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW315","id":28738,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO315","id":28315,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO317","id":28963,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW317","id":29044,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV042"}}}]
}
]
}
