"28356" : {
"id":28356,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV025: Hoe moet ProductCode gevuld worden in declaratiebericht of factuurbericht (303)?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Welke productcodes gebruikt mogen worden in het berichtenverkeer is afhankelijk van bilaterale afspraken. Er is een landelijke codelijst 021 - PRODUCTCODE beschikbaar. Gemeente en aanbieder leggen in de contractafspraken vast of deze codelijst gebruikt wordt. Het is ook mogelijk dat gemeenten een eigen productcodelijst gebruiken.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In een Declaratie/Factuur (303) wordt altijd een productcategorie en productcode gevuld. Indien in ToegewezenProduct alleen een productcategorie is gevuld (aspecifieke toewijzing), wordt deze productcategorie overgenomen en wordt een bijbehorende productcode (volgens de productcodelijst die gebruikt moet worden) gevuld. Dit betekent dat op een (1) ToegewezenProduct meerdere prestaties voor dezelfde periode kunnen volgen indien meerdere producten van dezelfde productcategorie zijn geleverd. Indien in ToegewezenProduct zowel de productcategorie als ook de productcode is gevuld (specifieke toewijzing), wordt hetzelfde zorg- of ondersteuningsproduct in de declaratie opgenomen. </span><span style=\" font-size: 10pt; font-family: Helvetica;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV025"}}}]
}
]
}
,
"28365" : {
"id":28365,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR112: Bij een nieuwe aanlevering mag deze datum maximaal 12 maanden in het verleden liggen.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Als StatusAanlevering de waarde '1' (eerste aanlevering) heeft, mag deze datum maximaal 12 maanden in het verleden liggen.&nbsp;<p style=\"margin-top: 3pt;\">Dat betekent dat EbStartDatum (WMO401) of EbStopDatum (WMO403) groter dan of gelijk moet zijn aan de dagtekening van het bericht minus 12 maanden.</span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO403","id":30333,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO401","id":30330,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR112","niveau":"standaard"}}}]
}
]
}
