"28349" : {
"id":28349,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV087: Hoe wordt een declaratie-antwoordbericht opgesteld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een declaratie-antwoordbericht wordt gestuurd om de aanbieder te informeren over de beoordeling (technisch/inhoudelijk) van het declaratiebericht. Daarnaast wordt de aanbieder geinformeerd over het totaalbedrag dat door de gemeente wordt toegekend op de declaratie</span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voor ieder verzonden declaratiebericht wordt slechts 1 declaratie-antwoordbericht gestuurd (1-op-1). De gemeente stuurt altijd een declaratie-antwoordbericht naar de aanbieder. &nbsp;&nbsp;&nbsp;<p style=\"margin-top: 3pt;\">* Bij afkeur op de technische controle (niveau 1 en 2, zie IV088) wordt na aanpassing van de fouten een nieuw declaratiebericht ingediend. Het afgekeurde declaratiebericht is niet verwerkt door de gemeente. &nbsp;<p style=\"margin-top: 3pt;\">* Bij afkeur op de inhoudelijke controle (niveau 3 en 4) worden de afgewezen prestaties, indien nodig en na aanpassing van de fouten, in een volgende declaratie verstuurd. &nbsp;<p style=\"margin-top: 3pt;\">De vulling van het declaratie-antwoordbericht is afhankelijk van de situatie en de geconstateerde fouten: &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Het bericht is volledig goedgekeurd: </b>&nbsp;<p style=\"margin-top: 3pt;\">De header wordt retour gestuurd met retourcode 0200 (geen opmerkingen over deze berichtklasse) en een Declaratie-Antwoord berichtklasse met Retourcode 8001 (Declaratie/Factuur is volledig toegewezen), waarbij TotaalGoedgekeurdBedrag &nbsp;en TotaalIngediendBedrag worden gevuld met de waarde van TotaalIngediendBedrag van het bijbehorende declaratiebericht.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Het bericht is volledig afgekeurd: &nbsp;<p style=\"margin-top: 3pt;\"></b>Afkeur op headerniveau:&nbsp;<p style=\"margin-top: 3pt;\">Header wordt retour gestuurd met retourcode 0001. Het declaratiebericht wordt als niet verzonden beschouwd en is niet verwerkt in de administratie van de gemeente.&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld:&nbsp;<p style=\"margin-top: 3pt;\">* Het bericht bevat een fout in de header of kan niet worden afgeleverd bij de gemeente: retourcode 0001 (Bericht is afgekeurd om technische reden).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Afkeur op Berichtklasse Declaratie:&nbsp;<p style=\"margin-top: 3pt;\">Header wordt retourgestuurd met retourcode 0200 (geen opmerking over deze berichtklasse), berichtklasse DeclaratieAntwoord krijgt de betreffende retourcode voor afkeur. Het TotaalToegekendBedrag wordt gevuld met 0 (zie ook TR342). &nbsp;De declaratie wordt als niet verzonden beschouwd en is niet verwerkt in de administratie van de gemeente. &nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld: &nbsp;<p style=\"margin-top: 3pt;\">* Het declaratienummer is niet uniek: Declaratienummer moet uniek zijn voor de verzendende partij. De header krijgt dan retourcode 0200 (geen opmerking over deze berichtklasse), <span style=\" font-family: Helvetica;\">berichtklasse DeclaratieAntwoord krijgt retourcode 9333, en bij TotaalToegekendBedrag wordt 0 gevuld&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-family: Helvetica;\"><b></span>&nbsp;<p style=\"margin-top: 3pt;\">Het bericht is gedeeltelijk afgekeurd:</b> &nbsp;<p style=\"margin-top: 3pt;\">De header wordt retour gestuurd met retourcode 0200 (Geen opmerking over deze berichtklasse). TotaalToegekendBedrag in de berichtklasse DeclaratieAntwoord wordt gevuld met het totaal goedgekeurde bedrag (som van alle toegekende prestaties). Indien een fout is geconstateerd in de Clientklasse, wordt de betreffende retourcode bij de Client gevuld en worden alle onderliggende Prestaties teruggestuurd met retourcode 0233 (Berichtklasse is niet beoordeeld). Indien een ingediende Prestatie wordt afgewezen, wordt deze Prestatie retour gezonden met de bijbehorende retourcode. Hierbij wordt tevens de bijbehorende klasse Client meegestuurd met retourcode 0200 (Geen opmerking over deze berichtklasse). In de retour gezonden Prestaties worden &#233;&#233;n of meerdere retourcodes gevuld om de inhoudelijke reden van afwijzing aan te geven.&nbsp;<p style=\"margin-top: 3pt;\">NB: Prestaties worden altijd volledig goed of volledig afgekeurd. Prestaties waarvan het ingediende bedrag wordt toegekend, worden niet opgenomen in het declaratie-antwoordbericht. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">Het declaratie-antwoordbericht dient niet: &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">* Als ontvangstbevestiging. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">* Voor het opvragen van (extra) informatie door de gemeente. &nbsp;<p style=\"margin-top: 3pt;\">* Voor het doorgeven van correcties op declaratiegegevens aan de aanbieder.&nbsp;<p style=\"margin-top: 3pt;\">"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO325","id":28732,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW325","id":29539,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV087"}}}]
}
]
}
