"29089" : {
"id":29089,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV081: Hoe moet het ProductTarief gevuld worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De eenheid in de prestatie moet gelijk zijn aan de eenheid van de toewijzing. Voor die eenheid dient in het contract een tarief voor het betreffende product te zijn vastgelegd. Het producttarief in de prestatie wordt gevuld met dat betreffende tarief.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Alleen voor uren en minuten is er een uitzondering mogelijk. Gemeente en aanbieder kunnen een tariefeenheid per uur afgesproken hebben, terwijl gedeclareerd wordt in minuten. In dat geval wordt in de Prestatie het ProductTarief omgerekend naar een tarief per minuut (tarief delen door 60 minuten) en afgerond op 2 decimalen volgens de rekenkundige regels. Dit betekent dat 1,455 wordt afgerond naar 1,46 en dat 1,454 wordt afgerond naar 1,45. &nbsp;<p style=\"margin-top: 3pt;\">Dit (afgeronde) tarief wordt in de Prestatie bij ProductTarief opgenomen, maar niet gebruikt voor de berekening van IngediendBedrag.Voor de berekening van het IngediendBedrag wordt het niet afgeronde tarief gebruikt. De afronding (op 2 decimalen) van het IngediendeBedrag vindt pas helemaal aan het eind van de berekening plaats.(TR346)&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 10pt; font-family: Calibri;\"></span><span style=\" font-size: 11pt; font-family: Calibri;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV081"}}}]
}
]
}
