"lang":"nl",
"name":"TR320: Alle deels toegekende en/of afgewezen prestaties dienen meegestuurd te worden in het retourbericht op een declaratie/factuur.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien niet alle prestaties van een ingediende factuur/declaratie (volledig) zijn toegekend, is er in het retourbericht een verschil tussen het totaal ingediende bedrag van de factuur/declaratie en het toegekende bedrag in het retourbericht. Dit verschil dient verklaard te kunnen worden uit de meegestuurde deels toegekende en/of afgewezen prestaties.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De volgende controle dwingt dit af:&nbsp;<p style=\"margin-top: 3pt;\">SOM (Prestatie.IngediendeBedragPrestatie.DeclaratieFactuurBedrag - Prestatie.ToegekendeBedragPrestatie.ToegekendBedrag) = Header.RetourBedragen.IngediendTotaalBedrag - ToegekendTotaalBedrag</span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO304","id":27964,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW304","id":28431,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR320","niveau":"standaard"}}}]
