"29277" : {
"id":29277,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV097: Hoe wordt ReferentieAanbieder gevuld in een ToegewezenProduct?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De ReferentieAanbieder wordt alleen gevuld wanneer een toewijzing wordt gestuurd als direct gevolg van een verzoek om toewijzing of een verzoek om wijziging.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Als een nieuwe of gewijzigde toewijzing wordt gestuurd op initiatief van de gemeente wordt ReferentieAanbieder niet gevuld, ook niet als in een eerder bericht ToegewezenProduct (met hetzelfde ToewijzingNummer) wel een gevuld element ReferentieAanbieder had.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld:</b> &nbsp;<p style=\"margin-top: 3pt;\">Na een verzoek om toewijzing wordt als gevolg daarvan een ToegewezenProduct gestuurd, deze bevat dan ReferentieAanbieder. Na verloop van tijd stuurt de gemeenten op haar initiatief een gewijzigde </span><span style=\" font-size: 10pt; font-family: Arial;\">ToegewezenProduct</span><span style=\" font-size: 10pt;\">, bijvoorbeeld met een Einddatum ingevuld. Deze gewijzigde toewijzing heeft dan geen ReferentieAanbieder omdat het geen direct gevolg van een verzoek is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Bij een verzoek om toewijzing heeft ieder gevraagd product een apart ReferentieAanbieder. Bij de </span><span style=\" font-size: 10pt; font-family: Arial;\">ToegewezenProduct</span><span style=\" font-size: 10pt;\">en die als direct gevolg van deze aanvraag worden gestuurd krijgt elk </span><span style=\" font-size: 10pt; font-family: Arial;\">ToegewezenProduct</span><span style=\" font-size: 10pt;\"> de ReferentieAanbieder uit het overeenkomstige gevraagde product.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Bij een verzoek om wijziging gaat het om een samenhangend geheel met 1 ReferentieAanbieder voor alle wijzigingen en/of extra producten.&nbsp;<p style=\"margin-top: 3pt;\">In het toewijzingbericht dat als gevolg van dit verzoek wordt gestuurd krijgen alle producten dezelfde ReferentieAanbieder in </span><span style=\" font-size: 10pt; font-family: Arial;\">ToegewezenProduct.</span><span style=\" font-size: 10pt;\">.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld:</b> &nbsp;<p style=\"margin-top: 3pt;\">Er lopen twee toegewezen producten:&nbsp;<p style=\"margin-top: 3pt;\">* ToewijzingNummer 345001, Product A, Ingangsdatum 1 januari 2020, einddatum 31 december 2020&nbsp;<p style=\"margin-top: 3pt;\">* ToewijzingNummer 345002, Product B, Ingangsdatum 1 januari 2020, einddatum 31 december 2020&nbsp;<p style=\"margin-top: 3pt;\">Er wordt een verzoek om wijziging gestuurd om de toewijzing van Product B te verlengen met een half jaar t/m 30 juni 2021, met ReferentieAanbieder 667788 (NB: beide producten moeten opgenomen worden in het verzoek om wijziging.)&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Als de gemeente dit verzoek honoreert dan wordt een toewijzing gestuurd met beide </span><span style=\" font-size: 10pt; font-family: Arial;\">ToegewezenProduct</span><span style=\" font-size: 10pt;\">en (conform regel OP087) met beiden dezelfde ReferentieAanbieder:&nbsp;<p style=\"margin-top: 3pt;\">* ToewijzingNummer 345001, Product A, Ingangsdatum 1 januari 2020, einddatum 31 december 2020, Referentieaanbieder 667788&nbsp;<p style=\"margin-top: 3pt;\">* ToewijzingNummer 345002, Product B, Ingangsdatum 1 januari 2020, einddatum 30 juni 2021, Referentieaanbieder 667788&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV097"}}}]
}
]
}
