"29768" : {
"id":29768,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV071: Wat is het verschil tussen een declaratie en een factuur?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een declaratie is een verantwoordingsdocument waarin geleverde dienst / product wordt weergegeven. Een factuur is een formeel financieel administratief document (met wettelijke eisen). Op een declaratie is een betaling niet per definitie wenselijk, op een factuur wel.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In financiele processen is een factuur een vordering. Bij een dispuut over een prestatie beoordeelt de opsteller zijn vordering opnieuw. Alleen als de opsteller besluit tot intrekking of correctie van de oorspronkelijke prestatie, zorgt hij voor een expliciete creditering, die de oorspronkelijke vordering opheft. Dat zorgt ervoor dat het geheel van de facturen (met oplopende factuurnummers) een dekkende set vormt van alle vorderingen.</span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV071"}}}]
}
]
}
