"29763" : {
"id":29763,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV088: Welke retourcode moet gevuld worden in het declaratie-antwoordbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Welke retourcode gevuld moet worden, wordt bepaald door controle op basis waarvan het bericht wordt afgekeurd. De retourcode wordt meegegeven bij de berichtklasse waarop de controle van toepassing is. &nbsp;<p style=\"margin-top: 3pt;\">Technische regels, condities en constraints die niet op basis van een XSD &#243;f XSLT validatie gecontroleerd kunnen worden, hebben een eigen retourcode. Overige regels gebruiken retourcode 0001 (Bericht is technisch onjuist). Daarnaast zijn nog een aantal algemene retourcodes beschikbaar. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Een ontvangen bericht wordt op vier niveau's gecontroleerd. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><u><b>Niveau 1: &nbsp;<p style=\"margin-top: 3pt;\"></u></b>Het bericht wordt gecontroleerd op leesbaarheid en gevalideerd tegen het XSD. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">Indien het bericht niet leesbaar is of niet valideert, krijgt de afzender een foutmelding. Er wordt geen declaratie-antwoordbericht verzonden. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><u><b>Niveau 2: &nbsp;<p style=\"margin-top: 3pt;\"></u></b>Het bericht wordt gecontroleerd tegen alle regels (technische regels, condities en constraints) die binnen het bericht zelf te controleren zijn. Voor deze regels zijn XSLT's beschikbaar die gebruikt kunnen worden om de controles uit te voeren. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd bevat het declaratie-antwoordbericht alleen de Header met retourcode 0001 (Bericht is technisch onjuist). Wanneer de ter beschikking gestelde XSLT's gebruikt zijn, wordt bovendien het versienummer van de XSLT's meegegeven. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><u><b>Niveau 3: &nbsp;<p style=\"margin-top: 3pt;\"></u></b>Het bericht wordt gecontroleerd op alle overige regels die niet binnen het bestand zelf gecontroleerd kunnen worden. Dit betekent dat onder andere wordt gecontroleerd op:&nbsp;<p style=\"margin-top: 3pt;\">* Systeemdatum om te bepalen of de dagtekening niet in de toekomst ligt;&nbsp;<p style=\"margin-top: 3pt;\">* Alle berichtoverstijgende technische regels;* Codelijsten die wel onderdeel zijn van de standaard, maar niet als enumeratie in de XSD's zijn opgenomen, zoals de gemeentelijke indeling van CBS.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd in de header, bevat het declaratie-antwoordbericht alleen de Header met de specifieke retourcode &nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd in de berichtklasse Declaratie, bevat het declaratie-antwoord bericht een header met retourcode 0200, een berichtklasse DeclaratieAntwoord met de specifieke retourcode.&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd in &nbsp;de berichtklassen Client &nbsp;, bevat het declaratie-antwoordbericht de header met retourcode 0200, een DeclaratieAntwoord met retourcode 0200, een berichtklasse Client met de specifieke retourcode en alle berichtklassen uit het heenbericht die horen bij die Client, voorzien van de retourcode 0233. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd in de berichtklasse Prestatie, bevat het declaratie-antwoord bericht een header met retourcode 0200, een berichtklasse DeclaratieAntwoord met retourcode 0200, een berichtklasse Client met retourcode 0200 en 1 of meer berichtklassen Prestatie met de specifieke retourcodes. De retourcode die hoort bij de regel op basis waarvan het bericht wordt afgekeurd, wordt ingevuld bij de berichtklasse waarin de fout is geconstateerd. &nbsp;<p style=\"margin-top: 3pt;\">Prestaties waarin geen fouten zijn geconstateerd worden niet opgenomen in het declaratie-antwoord bericht.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Let wel: aangezien de declaratie gegevens kan bevatten over meer clienten, kan ook het declaratie-antwoordbericht gegevens bevatten over meer clienten. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><u><b>Niveau 4: &nbsp;<p style=\"margin-top: 3pt;\"></u></b>Het bericht wordt gecontroleerd op aanvullende afspraken die niet gecontroleerd kunnen worden op basis van informatie die binnen de standaard wordt uitgewisseld. Het gaat bijvoorbeeld om controles t.o.v. contractafspraken, zoals het tarief.&nbsp;<p style=\"margin-top: 3pt;\">Deze retourcode wordt gevuld bij de prestatie waarop de afwijking geconstateerd is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><u><b>Let op:</u></b> Clienten waarvoor g&#233;&#233;n fouten zijn geconstateerd, worden niet opgenomen in het declaratie-antwoordbericht (zie OP304). &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><u><b>Voorbeeld vulling retourcodes:</u></b>De gemeente ontvangt een declaratie van een levering, maar de aanbieder heeft niet het juiste tarief gehanteerd. De prestatie in het declaratiebericht wordt dan afgekeurd.&nbsp;<p style=\"margin-top: 3pt;\">In het declaratie-antwoordbericht voor deze voorbeeld foutsituatie worden de volgende retourcodes gevuld: &nbsp;<p style=\"margin-top: 3pt;\">* Header: Retourcode 0200 (Geen opmerkingen over deze berichtklasse)&nbsp;<p style=\"margin-top: 3pt;\">* DeclaratieAntwoord: Retourcode 0200 (Geen opmerkingen over deze berichtklasse)&nbsp;<p style=\"margin-top: 3pt;\">* Client: Retourcode 0200 (Geen opmerkingen over deze berichtklasse)&nbsp;<p style=\"margin-top: 3pt;\">* Prestatie: Retourcode 0611 (Het ingediende tarief komt niet overeen met het contractuele tarief.) eventuele andere goedgekeurde prestaties voor deze client worden gewoon verwerkt en worden niet opgenomen in het declaratie-antwoordbericht.</span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO325","id":28732,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW325","id":29539,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV088"}}}]
}
]
}
