"data" : [
{
"lang":"nl",
"name":"IV095: Hoe moet de juiste gemeente gevuld worden.",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien de gemeente in het antwoordbericht aangeeft dat zij niet de verantwoordelijke gemeente is van de cli&#235;nt waarvoor een verzoek om toewijzing is ingediend, wordt RedenAfwijzingVerzoek in het antwoordbericht gevuld met de waarde 8 (Woonplaatsbeginsel). &nbsp;<p style=\"margin-top: 3pt;\">In dat geval kan de gemeente in Gemeente de gemeentecode meegeven die volgens haar wel de verantwoordelijke gemeente is. De aanbieder weet dan bij welke gemeente het verzoek om toewijzing moet worden ingediend.&nbsp;<p style=\"margin-top: 3pt;\">Bij alle andere waarden van RedenAfwijzingVerzoek dient de klasse Woonplaatsbeginsel niet te worden opgenomen.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"JW319","id":29533,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV095"}}}]
}
]
