"name":"OP259: Het is niet toegestaan om een zorg- of ondersteuningsproduct gestapeld toe te wijzen.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Gestapeld betekent dat voor &#233;&#233;n cli&#235;nt hetzelfde zorg- of ondersteuningsproduct meerdere keren wordt toegewezen aan dezelfde aanbieder voor (gedeeltelijk) dezelfde periode. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">Hetzelfde zorg- of ondersteuningsproduct betekent dezelfde productcode of dezelfde productcategorie indien productcode niet gevuld is. Indien productcategorie leeg is, geldt dat er geen ander toegewezen product voor (gedeeltelijk) dezelfde periode naast mag staan.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP259","geen technische regels":false}}}]
