"30954" : {
"id":30954,
"typeIconPath":"data/icons/UML/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"Binnen iStandaarden wordt ieder verzonden heenbericht beantwoord met een retourbericht. Doel van het retourbericht is om een ontvangstbevestiging of, in een aantal  gevallen, inhoudelijke terugkoppeling te geven. Een heenbericht dient binnen drie werkdagen te worden beantwoord. Voor de declaratie/factuurberichten (JW304) geldt dat  het retourbericht binnen 20 werkdagen verzonden moet zijn. .   De specificaties voor de retourberichten JW302, JW306, JW308, JW316, JW318 en JW320 worden op dezelfde manier opgebouwd. De specificaties van deze  retourberichten zijn gelijk aan de specificaties van de bijbehorende heenberichten. Daarop worden de volgende wijzigingen en aanvullingen doorgevoerd:  1. Header: ‚Ä¢  In de header wordt de BerichtCode gevuld met de berichtcode van het betreffende retourbericht. ‚Ä¢  De elementen Afzender, Ontvanger en BerichtIdentificatie worden ongewijzigd overgenomen van de header van het heenbestand. ‚Ä¢  De header wordt aangevuld met identificerende gegevens van het retourbestand (IdentificatieRetour en DagtekeningRetour).  2. Berichtklassen: * De berichtklasse Client is optioneel binnen het retourbericht; een retourbericht kan ook alleen een header bevatten. * Alle berichtklassen, inclusief de header, worden uitgebreid met een berichtklasse RetourCodes. * Berichtklasse RetourCodes is optioneel voor de header, voor alle overige berichtklassen moet RetourCodes verplicht worden opgenomen.   De JW302, JW306, JW308, JW316, JW318 en JW320 retourberichten kunnen op basis van het element Identificatie gekoppeld worden aan het bijbehorende heenbericht.   Het retourbericht JW304 kent een iets andere logica en wordt binnen het model apart gemodelleerd.  De JW304 kan op basis van het element DeclarantFactuurNummer gekoppeld worden aan het JW303 bericht",
"type":"Tekenvorm",
"categories":[]
}
]
}
