"typeIconPath":"data/icons/ArchiMate/BusinessActivity.png",
"data" : [
{
"lang":"nl",
"name":"Overdragen aan verantwoordelijke gemeente",
"type":"Bedrijfsactiviteit",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Wanneer volgens het woonplaatsbeginsel een andere gemeente verantwoordelijk is voor de client, vindt een overdracht plaats. De gemeente die het Verzoek om toewijzing ontvangen heeft, neemt buiten het berichtenverkeer om contact op met de aanbieder en met de verantwoordelijke gemeente. De aanbieder verstuurt vervolgens het Verzoek om toewijzing aan de verantwoordelijke gemeente.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De gemeente die de aanvraag ontvangt is verantwoordelijk voor de client, tot het moment dat de client is overgedragen aan de gemeente die volgens het woonplaatsbeginsel verantwoordelijk is voor de client. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
