"53926" : {
"id":53926,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"Een bericht is een verzameling gegevens die samen een logisch geheel, ofwel een mededeling vormen. Een  bericht bevat gecodeerde gegevens over een client in het zorgproces, dat kan gaan over bijvoorbeeld een toewijzing of declaratie. Binnen iJw wordt onderscheid gemaakt tussen rechtmatigheidsberichten, waaraan partijen  rechten kunnen ontlenen, en regieberichten, die enkel bedoeld zijn om inzicht te bieden in het proces.  Elk bericht bevat een aantal \"'basisblokken\" ofwel berichtklassen, bijvoorbeeld Client, Beschikking en  ToegewezenProduct. Deze berichtklassen bevatten op hun beurt √©√©n of meer berichtelementen. Zo bevat bijvoorbeeld  de berichtklasse Client berichtelementen naam, geslacht, BSN en geboortedatum. Elk bericht kent een retourbericht  met als doel om een ontvangstbevestiging of, in een aantal gevallen, inhoudelijke terugkoppeling te geven.   Elk berichtelement wordt gedefinieerd door een bepaald datatype, dat op zijn beurt gebruik kan maken van een codelijst, ook wel enumeratie genoemd (zie tabblad Gegevens).",
"type":"Tekenvorm",
"categories":[]
}
]
}
