"data" : [
{
"lang":"nl",
"name":"Een bericht is een verzameling gegevens die samen een logisch geheel, ofwel een mededeling vormen. Binnen  iEb bevat een bericht gecodeerde gegevens voor de bepaling van de eigen bijdrage van een client in de Wmo.   Elk bericht bevat een aantal \"'basisblokken\" ofwel berichtklassen, bijvoorbeeld Client of StartEigenBijdrage. Deze berichtklassen bevatten op hun beurt √©√©n of meer berichtelementen. Zo bevat bijvoorbeeld de berichtklasse Client berichtelement BSN. Elk bericht kent een retourbericht met als doel om een ontvangstbevestiging te geven.   Elk berichtelement wordt gedefinieerd door een bepaald datatype, dat op zijn beurt gebruik kan maken van een codelijst, ook wel enumeratie genoemd (zie tabblad Gegevens).",
"type":"Tekenvorm",
"categories":[]
}
]
